import "./index.css";
import { Route, Routes } from "react-router-dom";
import Homepage from "./Homepage";
import Details from "./Details";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Homepage />} />
        <Route path="Details" element={<Details />} />
      </Routes>
      <Homepage />
      <Details />
    </div>
  );
}

export default App;
